(2, 'Bing', 'Bing (formerly Live Search, Windows Live Search, and MSN Search) is a web search engine (advertised as a "decision engine") from Microsoft. Bing was unveiled by Microsoft CEO Steve Ballmer on May 28, 2009 at the All Things Digital conference in San Diego. It went fully online on June 3, 2009,[3] with a preview version released on June 1, 2009.\r\nNotable changes include the listing of search suggestions as queries are entered and a list of related searches (called "Explore pane") based on[4] semantic technology from Powerset that Microsoft purchased in 2008.[5]\r\nOn July 29, 2009, Microsoft and Yahoo! announced a deal in which Bing would power Yahoo! Search. All Yahoo! Search global customers and partners are expected to have made the transition by early 2012. ', 'www.bing.com', 'Search Bing Microsoft Steve Ballmer'),
(3, 'Yahoo! ', 'Yahoo! Inc.  is an American internet corporation founded in Santa Clara, California and headquartered in Sunnyvale, California, United States. The company is perhaps best known for its web portal, search engine (Yahoo! Search), Yahoo! Directory, Yahoo! Mail, Yahoo! News, advertising, online mapping (Yahoo! Maps), video sharing (Yahoo! Video), and social media websites and services. It is one of the largest websites in the United States.\r\nYahoo! was founded by Jerry Yang and David Filo in January 1994 and was incorporated on March 1, 1995. On January 13, 2009, Yahoo! appointed Carol Bartz, former executive chairperson of Autodesk, as its new chief executive officer and a member of the board of directors.', 'www.yahoo.com\r\n', 'Yahoo.com Yahoo'),
